DROP TABLE IF EXISTS `npc`;
CREATE TABLE `npc` (
  `id` int(11) unsigned NOT NULL DEFAULT '0',
  `name` varchar(45) DEFAULT NULL,
  `title` varchar(65) NOT NULL DEFAULT '',
  `collision_radius` decimal(5,2) DEFAULT NULL,
  `collision_height` decimal(5,2) DEFAULT NULL,
  `level` int(11) DEFAULT NULL,
  `sex` varchar(6) DEFAULT NULL,
  `type` varchar(25) DEFAULT NULL,
  `ai_type` varchar(50) DEFAULT NULL,
  `attackrange` int(11) DEFAULT NULL,
  `hp` float DEFAULT NULL,
  `hp_mod` double(11,5) NOT NULL DEFAULT '1.00000',
  `base_hp_regen` double(11,3) NOT NULL DEFAULT '0.000',
  `mp` float DEFAULT NULL,
  `base_mp_regen` double(11,3) NOT NULL DEFAULT '0.000',
  `str` int(11) DEFAULT NULL,
  `con` int(11) DEFAULT NULL,
  `dex` int(11) DEFAULT NULL,
  `int` int(11) DEFAULT NULL,
  `wit` int(11) DEFAULT NULL,
  `men` int(11) DEFAULT NULL,
  `exp` int(11) DEFAULT NULL,
  `sp` int(11) DEFAULT NULL,
  `patk` float DEFAULT NULL,
  `pdef` float DEFAULT NULL,
  `matk` float DEFAULT NULL,
  `mdef` float DEFAULT NULL,
  `atkspd` int(11) DEFAULT NULL,
  `aggro` int(11) DEFAULT NULL,
  `matkspd` int(11) DEFAULT NULL,
  `rhand` int(11) DEFAULT NULL,
  `lhand` int(11) DEFAULT NULL,
  `armor` int(11) DEFAULT NULL,
  `walkspd` int(11) DEFAULT NULL,
  `runspd` int(11) DEFAULT NULL,
  `faction_id` varchar(40) DEFAULT NULL,
  `faction_range` int(11) DEFAULT NULL,
  `displayId` int(11) NOT NULL DEFAULT '0',
  `shield_defense_rate` int(11) DEFAULT NULL,
  `shield_defense` int(11) DEFAULT NULL,
  `corpse_time` int(11) DEFAULT NULL,
  `base_rand_dam` int(11) DEFAULT NULL,
  `base_critical` int(11) DEFAULT NULL,
  `physical_hit_modify` double(11,2) DEFAULT '0.00',
  `base_reuse_delay` int(11) DEFAULT NULL,
  `physical_avoid_modify` double(11,2) DEFAULT '0.00',
  `hit_time_factor` double(11,2) DEFAULT '0.00',
  `isDropHerbs` enum('false','true') NOT NULL DEFAULT 'false',
  `shots` enum('NONE','SOUL','SPIRIT','BSPIRIT','SOUL_SPIRIT','SOUL_BSPIRIT') NOT NULL DEFAULT 'NONE',
  `ignore_clan_list` varchar(100) DEFAULT NULL,
  `soulshot_count` tinyint(4) NOT NULL DEFAULT '0',
  `spiritshot_count` tinyint(4) NOT NULL DEFAULT '0',
  `base_attr_attack` tinyint(4) NOT NULL DEFAULT '0',
  `base_attr_attack_value` int(11) NOT NULL DEFAULT '0',
  `base_attr_def_fire` int(11) NOT NULL DEFAULT '0',
  `base_attr_def_water` int(11) NOT NULL DEFAULT '0',
  `base_attr_def_wind` int(11) NOT NULL DEFAULT '0',
  `base_attr_def_earth` int(11) NOT NULL DEFAULT '0',
  `base_attr_def_holy` int(11) NOT NULL DEFAULT '0',
  `base_attr_def_dark` int(11) NOT NULL DEFAULT '0',
  `base_attr_unk` int(11) NOT NULL DEFAULT '0',
  `undying` tinyint(1) NOT NULL DEFAULT '0',
  `can_be_attacked` tinyint(1) NOT NULL DEFAULT '1',
  `can_move` tinyint(1) NOT NULL DEFAULT '1',
  `flying` tinyint(1) NOT NULL DEFAULT '0',
  `targetable` tinyint(1) NOT NULL DEFAULT '1',
  `show_name_tag` tinyint(1) NOT NULL DEFAULT '1',
  `unsowing` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


